odule"":{""free"":false,""health"":1000000,""id"":128064223,""name"":""Int_Sensors_Size2_Class1"",""on"":true,""priority"":1,""unloaned"":1448,""value"":1448}},""Slot01_Size5"":[],""Slot02_Size5"":[],""Slot03_Size4"":[],""Slot04_Size4"":[],""Slot05_Size3"":[],""Slot06_Size2"":[],""Slot07_Size2"":[],""SmallHardpoint1"":[],""SmallHardpoint2"":[],""TinyHardpoint1"":[],""TinyHardpoint2"":[],""TinyHardpoint3"":[],""WeaponColour"":[]},""name"":""Type6"",""oxygenRemaining"":300000,""passengers"":[],""refinery"":null,""starsystem"":{""id"":""7268829046225"",""name"":""Cowini"",""systemaddress"":""7268829046225""},""station"":{""id"":3225606912,""name"":""Havilland Dock""},""value"":{""cargo"":0,""hull"":708891,""modules"":60310,""total"":769201,""unloaned"":60310}}}}";

            Profile profile = CompanionAppService.ProfileFromJson(data);

            Assert.IsNotNull(profile);

            Ship ship = profile.Ship;

            // Huge multicannon with corrosive shell
            Module hugeHp1 = ship.hardpoints[0].module;
            Assert.IsNotNull(hugeHp1);
            List<Modification> hugeHp1Modifications = hugeHp1.modifications;
            Assert.AreEqual(0.035f, (double)hugeHp1Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(0.088f, (double)hugeHp1Modifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(0.345f, (double)hugeHp1Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);
            Assert.AreEqual(0.481f, (double)hugeHp1Modifications.First(m => m.id == Modification.DISTDRAW).value, 0.001f);
            Assert.AreEqual(-0.374f, (double)hugeHp1Modifications.First(m => m.id == Modification.THERMLOAD).value, 0.001f);
            Assert.AreEqual(0.244f, (double)hugeHp1Modifications.First(m => m.id == Modification.ROF).value, 0.001f);
            Assert.AreEqual(-0.2f, (double)hugeHp1Modifications.First(m => m.id == Modification.AMMO).value, 0.001f);

            // Huge multicannon with incendiary rounds
            Module hugeHp2 = ship.hardpoints[1].module;
            Assert.IsNotNull(hugeHp2);
            List<Modification> hugeHp2Modifications = hugeHp2.modifications;
            Assert.AreEqual(0.015f, (double)hugeHp2Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(0.037f, (double)hugeHp2Modifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            //Assert.AreEqual(0.433f, (double)hugeHp2Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);
            Assert.AreEqual(0.605f, (double)hugeHp2Modifications.First(m => m.id == Modification.DISTDRAW).value, 0.001f);
            Assert.AreEqual(2f, (double)hugeHp2Modifications.First(m => m.id == Modification.THERMLOAD).value, 0.001f);
            Assert.AreEqual(0.166f, (double)hugeHp2Modifications.First(m => m.id == Modification.ROF).value, 0.001f);

            // Medium pulse with scramble spectrum
            Module mediumHp2 = ship.hardpoints[4].module;
            Assert.IsNotNull(mediumHp2);
            List<Modification> mediumHp2Modifications = mediumHp2.modifications;
            Assert.AreEqual(-0.190f, (double)mediumHp2Modifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(-0.282f, (double)mediumHp2Modifications.First(m => m.id == Modification.POWER).value, 0.001f);
            Assert.AreEqual(0.077f, (double)mediumHp2Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);
            Assert.AreEqual(-0.283f, (double)mediumHp2Modifications.First(m => m.id == Modification.DISTDRAW).value, 0.001f);
            Assert.AreEqual(-0.832f, (double)mediumHp2Modifications.First(m => m.id == Modification.THERMLOAD).value, 0.001f);
            Assert.AreEqual(-0.157f, (double)mediumHp2Modifications.First(m => m.id == Modification.ROF).value, 0.001f);

            // Small pulse with scramble spectrum
            Module smallHp1 = ship.hardpoints[5].module;
            Assert.IsNotNull(smallHp1);
            List<Modification> smallHp1Modifications = smallHp1.modifications;
            Assert.AreEqual(-0.214f, (double)smallHp1Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(-0.267f, (double)smallHp1Modifications.First(m => m.id == Modification.POWER).value, 0.001f);
            Assert.AreEqual(0.185f, (double)smallHp1Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);
            Assert.AreEqual(-0.131f, (double)smallHp1Modifications.First(m => m.id == Modification.DISTDRAW).value, 0.001f);
            Assert.AreEqual(-0.827f, (double)smallHp1Modifications.First(m => m.id == Modification.THERMLOAD).value, 0.001f);
            Assert.AreEqual(-0.067f, (double)smallHp1Modifications.First(m => m.id == Modification.PIERCING).value, 0.001f);
            Assert.AreEqual(-0.175f, (double)smallHp1Modifications.First(m => m.id == Modification.ROF).value, 0.001f);
        }

