            Profile profile = CompanionAppService.ProfileFromJson(data);

            Assert.IsNotNull(profile);

            Ship ship = profile.Ship;

            // Large turreted burst laser
            Module largeHp1 = ship.hardpoints[0].module;
            Assert.IsNotNull(largeHp1);
            List<Modification> largeHp1Modifications = largeHp1.modifications;
            Assert.AreEqual(-0.087f, (double)largeHp1Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(-0.176f, (double)largeHp1Modifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(-0.008f, (double)largeHp1Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);

            // Second large is unmodified

            // Medium seeker missile rack
            Module largeHp3 = ship.hardpoints[2].module;
            Assert.IsNotNull(largeHp3);
            List<Modification> largeHp3Modifications = largeHp3.modifications;
            Assert.AreEqual(-0.024f, (double)largeHp3Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(-0.195f, (double)largeHp3Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);
            Assert.AreEqual(-0.173f, (double)largeHp3Modifications.First(m => m.id == Modification.DISTDRAW).value, 0.001f);
            Assert.AreEqual(0.397f, (double)largeHp3Modifications.First(m => m.id == Modification.THERMLOAD).value, 0.001f);
            Assert.AreEqual(0.062f, (double)largeHp3Modifications.First(m => m.id == Modification.PIERCING).value, 0.001f);
            Assert.AreEqual(0.314f, (double)largeHp3Modifications.First(m => m.id == Modification.ROF).value, 0.001f);
            Assert.AreEqual(.0196f, (double)largeHp3Modifications.First(m => m.id == Modification.JITTER).value, 0.0001f);

            // Medium gimballed multi-cannon with corrosive shell
            Module mediumHp1 = ship.hardpoints[3].module;
            Assert.IsNotNull(mediumHp1);
            List<Modification> mediumHp1Modifications = mediumHp1.modifications;
            Assert.AreEqual(0.376f, (double)mediumHp1Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(0.061f, (double)mediumHp1Modifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(0.218f, (double)mediumHp1Modifications.First(m => m.id == Modification.POWER).value, 0.001f);
            Assert.AreEqual(-0.013f, (double)mediumHp1Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);
            Assert.AreEqual(0.578f, (double)mediumHp1Modifications.First(m => m.id == Modification.CLIP).value, 0.001f);
            Assert.AreEqual(0.246f, (double)mediumHp1Modifications.First(m => m.id == Modification.AMMO).value, 0.001f);
            Assert.AreEqual(0.341f, (double)mediumHp1Modifications.First(m => m.id == Modification.RELOAD).value, 0.001f);

            // Medium gimballed multi-cannon with thermal shock
            Module mediumHp2 = ship.hardpoints[4].module;
            Assert.IsNotNull(mediumHp2);
            List<Modification> mediumHp2Modifications = mediumHp2.modifications;
            Assert.AreEqual(-0.48f, (double)mediumHp2Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(-0.376f, (double)mediumHp2Modifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(-0.008f, (double)mediumHp2Modifications.First(m => m.id == Modification.POWER).value, 0.001f);
            Assert.AreEqual(-0.292f, (double)mediumHp2Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);

            // Tiny shield booster
            Module tinyHp1 = ship.hardpoints[7].module;
            Assert.IsNotNull(tinyHp1);
            List<Modification> tinyHp1Modifications = tinyHp1.modifications;
            Assert.AreEqual(-0.017f, (double)tinyHp1Modifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(0.052f, (double)tinyHp1Modifications.First(m => m.id == Modification.POWER).value, 0.001f);
            //Assert.AreEqual(0.013f, (double)tinyHp1Modifications.First(m => m.id == Modification.KINRES).value, 0.001f);
            //Assert.AreEqual(0.013f, (double)tinyHp1Modifications.First(m => m.id == Modification.THERMRES).value, 0.001f);
            //Assert.AreEqual(0.013f, (double)tinyHp1Modifications.First(m => m.id == Modification.EXPLRES).value, 0.001f);

            // Power plant
            List<Modification> ppModifications = ship.powerplant.modifications;
            Assert.AreEqual(-0.038f, (double)ppModifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(0.050f, (double)ppModifications.First(m => m.id == Modification.PGEN).value, 0.001f);
            Assert.AreEqual(0.076f, (double)ppModifications.First(m => m.id == Modification.EFF).value, 0.001f);

            // Thrusters
            List<Modification> thrustersModifications = ship.thrusters.modifications;
            Assert.AreEqual(0.068f, (double)thrustersModifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(0.186f, (double)thrustersModifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(-0.014f, (double)thrustersModifications.First(m => m.id == Modification.OPTMUL).value, 0.001f);
            Assert.AreEqual(-0.056f, (double)thrustersModifications.First(m => m.id == Modification.THERMLOAD).value, 0.001f);

            // FSD
            List<Modification> fsdModifications = ship.frameshiftdrive.modifications;
            Assert.AreEqual(0.378f, (double)fsdModifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(-0.194f, (double)fsdModifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(0.195f, (double)fsdModifications.First(m => m.id == Modification.POWER).value, 0.001f);
            Assert.AreEqual(-0.044f, (double)fsdModifications.First(m => m.id == Modification.BOOT).value, 0.001f);
            Assert.AreEqual(0.249f, (double)fsdModifications.First(m => m.id == Modification.OPTMASS).value, 0.001f);
            Assert.AreEqual(0.037f, (double)fsdModifications.First(m => m.id == Modification.THERMLOAD).value, 0.001f);
            Assert.AreEqual(0.019f, (double)fsdModifications.First(m => m.id == Modification.MAXFUEL).value, 0.001f);

            // Power distributor
            List<Modification> pdModifications = ship.powerdistributor.modifications;
            Assert.AreEqual(0.080f, (double)pdModifications.First(m => m.id == Modification.WEPCAP).value, 0.001f);
            Assert.AreEqual(0.028f, (double)pdModifications.First(m => m.id == Modification.WEPRATE).value, 0.001f);
            Assert.AreEqual(-0.047f, (double)pdModifications.First(m => m.id == Modification.ENGCAP).value, 0.001f);
            Assert.AreEqual(-0.040f, (double)pdModifications.First(m => m.id == Modification.ENGRATE).value, 0.001f);
            Assert.AreEqual(-0.032f, (double)pdModifications.First(m => m.id == Modification.SYSCAP).value, 0.001f);
            Assert.AreEqual(-0.016f, (double)pdModifications.First(m => m.id == Modification.SYSRATE).value, 0.001f);
        }


