            Profile profile = CompanionAppService.ProfileFromJson(data);

            Assert.IsNotNull(profile);

            Ship ship = profile.Ship;

            // Large turreted burst laser with scramble spectrum
            Module largeHp1 = ship.hardpoints[0].module;
            Assert.IsNotNull(largeHp1);
            List<Modification> largeHp1Modifications = largeHp1.modifications;
            Assert.AreEqual(-0.135f, (double)largeHp1Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
