            // Large turreted burst laser 
            Module largeHp2 = ship.hardpoints[1].module;
            Assert.IsNotNull(largeHp2);
            List<Modification> largeHp2Modifications = largeHp2.modifications;
            Assert.AreEqual(-0.141f, (double)largeHp2Modifications.First(m => m.id == Modification.MASS).value, 0.001f);
            Assert.AreEqual(-0.173f, (double)largeHp2Modifications.First(m => m.id == Modification.INTEGRITY).value, 0.001f);
            Assert.AreEqual(0.018f, (double)largeHp2Modifications.First(m => m.id == Modification.DAMAGE).value, 0.001f);
            Assert.AreEqual(0.054f, (double)largeHp2Modifications.First(m => m.id == Modification.DISTDRAW).value, 0.001f);
        }
    }
}
